import Checkout from './Checkout';
import Header from './Header';
import Home from './Home';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/checkout'>
          <Header/>
          <Checkout/>
          </Route>

          <Route path='/'>

          </Route>
        </Switch>
      </Router>
      <Header/>
      <Home/>

    </div>
  );
}

export default App;
